// HomePage.js
import React from 'react';
import yourSvg from './components/HomePage.svg';

const HomePage = () => {
  return (

    <div>
      <video autoPlay loop muted playsInline style={{ position: 'absolute', top: 0, left: 0, width: '100%', height: '100%' }}>
        <source src="./components/background.mp4" type="video/mp4"></source>
      </video>
    </div>
  );
};

export default HomePage;
